import React from 'react';
import classes from './Post.module.css';


const Post = () => {
	return <div className={classes.post}>
		<div className={classes.circle}></div>
		<p>post 1</p>
		<div>
			<span><img src='https://mywebicons.ru/i/png/51f90108518a04fc0e908215a009ff75.png' alt='like'></img></span>
		</div>
	</div>



}

export default Post
